import React from "react";


const EventComponent: React.FC = () => {
  const onChange = (e:React.ChangeEvent<HTMLInputElement>) => {
    console.log(e.target.value);
  };
  return (
    <div>
      <input type="text" onChange={onChange} />
      <div>
        Drag Me!
      </div>
    </div>
  );
};

export default EventComponent;
